import React from "react";
import { Text, View, StyleSheet } from "react-native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

import MallPage from "./Childer/MallPage/MallPage";
import ContactPage from "./Childer/Contactpage/ContactPage";
import CartPage from "./Childer/Cartpage/CartPage";

const Tab = createBottomTabNavigator();

const Main = ({ navigation }) => {
  return (
    <Tab.Navigator
    screenOptions={{
      headerShown: false,
      style:{
        
          Position:'absolute',
          bottom:25,
          left:20,
          right:20,
          elevation:0,
          background
          
        
      }
    }}>
      <Tab.Screen name="Mall Page" component={MallPage}></Tab.Screen>
      <Tab.Screen name="Contact Page" component={ContactPage}></Tab.Screen>
      <Tab.Screen name="Cart" component={CartPage}></Tab.Screen>
    </Tab.Navigator>
  );
};
export default Main;
const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignContent: "center",
  },
  text: {
    justifyContent: "center",
    alignContent: "center",

    fontWeight: "bold",
    fontSize: 20,
  },
});
